{
  return vLedPositions;
}

export function Initialize()
{
    if(DpiControl) {
        setDpi(dpi1);
    }
    
}

function sendColors(shutdown = false){

    var packet = []
    //packet[0x00] = 0x00;
    packet[0x00]   = G600_RGB_WRITE;

    // Fetch color at 1,1
    var iX = vLedPositions[0][0];
    var iY = vLedPositions[0][1];

    var col;
    if(shutdown){
        col = hexToRgb(shutdownColor)
    }else if (LightingMode == "Forced") {
        col = hexToRgb(forcedColor)
    }else{
        col = device.color(iX, iY);
    }

    //assign to packets 2-4
    packet[0x01] = col[0];
    packet[0x02] = col[1];
    packet[0x03] = col[2];
    //packet 5 is mode
    packet[0x04] = G600_FIXED_MODE;
    //packet 6 is effect duration, default 4
    packet[0x05] = 0x04;
    //both 0
    packet[0x06] = 0x00;
    packet[0x07] = 0x00;

    device.send_report(packet, 8);

}
export function Render()
{
    sendColors()

    if(savedDpi1 != dpi1 && DpiControl){
       setDpi(dpi1)
    }

}
function setDpi(dpi){

savedDpi1 = dpi;
var packet = [];
packet[0] = 0xF2;
packet[1] = 0x02;
packet[2] = 0x00;
packet[3] = Math.round(dpi/50);
packet[4] = 0x00;
device.send_report(packet, 8);


}
function hexToRgb(hex) {
var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
var colors = [];
colors[0] = parseInt(result[1], 16);
colors[1] = parseInt(result[2], 16);
colors[2] = parseInt(result[3], 16);
return colors;
}

export function Validate(endpoint)
{
    return  endpoint.interface === 1 && endpoint.usage === 0x0080;
}

export function Shutdown()
{
    sendColors(true);
}

